import { useState } from "react";

const person = {
  name: "Haris",
  address: "lahore punjab pakistan",
  profiles: ["twitter", "instgram", "facebook"],
  printprofiles: () => {
    console.log(person.profiles);
  },
};

export default function FirstComp() {
  const [count, ssetcount] = useState(0);

  function incrementbutton() {
    ssetcount(count + 1);
    console.log(count);
  }
 function decrementbutton() {
    ssetcount(count-1);
    console.log(count);
  }




  return (
    <>
      <div className="FirstComp">
        <p>hello Haris hi thiw is a firsst component of the raeact</p>
      </div>
      <div>{person.name}</div>
      <div>{person.address}</div>
      <div>{person.printprofiles()}</div>

      <div className="Counter">
        <span className="count">{count}</span>

        <div>
          <button className="countetbutton" onClick={incrementbutton}>
        
            +1
          </button>
        </div>
        <div>
          <button className="countetbutton" onClick={decrementbutton}>
        
            -1
          </button>
        </div>
      </div>
    </>
  );
}
